import { Injectable } from '@nestjs/common';
import { PdfMakeService } from '../pdfMake/pdfMake.service';

@Injectable()
export class PdfService {
  private pdfMaker: PdfMakeService;

  constructor() {
    this.pdfMaker = new PdfMakeService();
  }

  async generateSamplePdf(): Promise<Buffer> {
    const rows = Array.from({ length: 100 }, (_, index) => [
      `Linha ${index + 1} - Coluna 1`,
      `Linha ${index + 1} - Coluna 2`,
      `Linha ${index + 1} - Coluna 3`,
    ]);

    // Adicione o Base64 da imagem aqui
    const logoBase64 = 'data:image/jpeg;base64,';  // Logo da imagem no cabeçalho
    const footerBase64 = 'data:image/jpeg;base64,';  // Imagem do rodapé

    const docDefinition = {
      footer: function (currentPage, pageCount) {
        return [
          {
            image: footerBase64,
            width: 600, // Largura da imagem
            alignment: 'left',
            margin: [10, 0, 0, 10]  // Ajuste da margem inferior
          }
        ]
      },
      header: function (currentPage, pageCount, pageSize) {
        return [
          {
            image: logoBase64,
            width: 600, // Largura da imagem
            alignment: 'left',
            margin: [10, 10, 0, 0] // Margens: [esquerda, topo, direita, baixo]
          }
        ];
      },
      content: [
        { text: 'Relatório Exemplo', style: 'header' },
        'Este é um exemplo de conteúdo gerado com pdfMake no NestJS.',
        { text: 'Lista:', style: 'subheader' },
        {
          ul: ['Item 1', 'Item 2', 'Item 3'],
        },
        { text: 'Tabela Exemplo:', style: 'subheader', margin: [0, 20, 0, 10] },
        {
          table: {
            widths: ['*', 'auto', 100],
            body: [
              [
                { text: 'Coluna 1', style: 'tableHeader' },
                { text: 'Coluna 2', style: 'tableHeader' },
                { text: 'Coluna 3', style: 'tableHeader' },
              ],
              ...rows,
            ],
          },
          layout: 'lightHorizontalLines',
        },
      ],
      styles: {
        header: { fontSize: 18, bold: true, alignment: 'center' },
        subheader: { fontSize: 14, bold: true },
        tableHeader: { bold: true, fontSize: 13, color: 'black' },
        footer: { fontSize: 10, italics: true },
      },
      pageMargins: [40, 100, 40, 60],  // Define margens para a página
    };

    return this.pdfMaker.generatePdf(docDefinition);
  }
}
